const sqlite3 = require('sqlite3');
const sqlite = require('sqlite');

const getUserExceptMainUserMovies = async (db, id, subId) => {
    return await db.all('SELECT ratings.movieId, title, ratings.rating FROM ratings, users, movies WHERE users.id = userId AND movies.id = movieId AND users.id = ? AND movieId NOT IN (SELECT ratings.movieId FROM ratings, users, movies WHERE users.id = userId AND movies.id = movieId AND users.id = ?)', [subId, id])
}

